import React from "react";
import logo from "./ApartmintLogoSmall.png";
import "./App.css";
import topNavBar from "./components/navBar/navBar";

function App() {
  return (
    <div className="App">
      <topNavBar />

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
